import './HeaderStyles.css';
const Search = () => {
  return (
    <div className='search'>
      <input type='text'
            className='inputBox'
      />
      <div className='icon-search'>
        logo search
      </div>
      <button>Search</button>
    </div>
  );
}

export default Search;
